[特徴]<br>
薄く軽く、縦横斜めに伸縮するストレッチ生地。<br>
裾ドローコード入りのため、裾が降りて足にからみにくく、ラインがきれいです。<br>
動きやすいのであらゆるスポーツにおすすめです。<br>
■ポケットは、左右・左腿の計3箇所<br>
■ウエスト調整紐付き<BR>
■吸汗速乾/ドライ<BR>
■裾にドローコード付き<BR>
